function Question({
  question,
  wrongAnswer,
  wrongAnswerComment,
  correctAnswer,
  correctAnswerComment
}) {
  return (
    <div>
      {question}
      {wrongAnswer}
      {wrongAnswerComment}
      {correctAnswer}
      {correctAnswerComment}
    </div>
  );
}

export default Question;
